const FontFaceObserver = require('fontfaceobserver')

const Fonts = () => {
  const link = document.createElement('link')
  link.href = 'https://fonts.googleapis.com/css2?family=Handlee&family=Kalam&family=Merienda+One&family=Pacifico&family=Raleway:ital,wght@1,600&family=Roboto:ital,wght@1,300&display=swap'
  link.rel = 'stylesheet'

  document.head.appendChild(link)

  const roboto = new FontFaceObserver('Roboto')

  roboto.load().then(() => {
    document.documentElement.classList.add('roboto')
  })

  const handlee = new FontFaceObserver('Handlee')

  handlee.load().then(() => {
    document.documentElement.classList.add('handlee')
  })

  const kalam = new FontFaceObserver('Kalam')

  kalam.load().then(() => {
    document.documentElement.classList.add('kalam')
  })

  const meriendaOne = new FontFaceObserver('Merienda+One')

  meriendaOne.load().then(() => {
    document.documentElement.classList.add('meriendaOne')
  })

  const pacifico = new FontFaceObserver('Pacifico')

  pacifico.load().then(() => {
    document.documentElement.classList.add('pacifico')
  })

  const raleway = new FontFaceObserver('Raleway')

  raleway.load().then(() => {
    document.documentElement.classList.add('raleway')
  })
}

export default Fonts
